import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Register from "./Components/Register";
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/" exact component={Register} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
